          <h3 className="intro">Self-Learning Software Engineering through Research and Development</h3>
        </div>
      </div>
      <div className="container-fluid">
        <div className="container">
          <h3 className="subTitle">MY WORK</h3>
          <p class="subText extPad">Hey Im Prabhakar, i spend most of my waking hours
